   //         );\n            //     },\n            // },\n            {\n                title: \"Tech Speaker\",\n                description: \"Shashank\",\n                src: _public_images_tech_speaker_shashank_webp__WEBPACK_IMPORTED_MODULE_43__[\"default\"],\n                ctaText: \"View\",\n                content: ()=>{\n                    return /*#__PURE__*/ (0,react_jsx_dev_runtime__WEBPACK_IMPORTED_MODULE_0__.jsxDEV)(\"p\", {\n                        children: `Shashank is a cybersecurity leader with over 10 years of experience, driven by a passion to make the internet safer.  He's the Co-founder & CEO of CredShields, building SolidityScan.com, a cloud-based smart contract security scanner. Previously, he was a Security Analyst at HackerOne and a Team Lead at Cobalt.io, leading teams and performing hundreds of penetration tests for various clients.  He's also a seasoned ethical hacker who has reported security vulnerabilities to tech giants like Facebook, Google, and Apple. Shashank holds AWS certifications and has deep expertise in smart contract security, web and blockchain security, and ethical hacking.`\n                    }, void 0, false, {\n                        fileName: \"D:\\\\AmitUpadhyay_MultiQos\\\\ReactTasks\\\\bsides_original\\\\besides\\\\components\\\\JsonFiles\\\\home.js\",\n                        lineNumber: 1734,\n                        columnNumber: 25\n                    }, undefined);\n                }\n            },\n            {\n                title: \"Tech Speaker\",\n                description: \"Nitesh Surana\",\n                src: _public_images_tech_speaker_nitesh_surana_webp__WEBPACK_IMPORTED_MODULE_39__[\"default\"],\n                ctaText: \"View\",\n                content: ()=>{\n                    return /*#__PURE__*/ (0,react_jsx_dev_runtime__WEBPACK_IMPORTED_MODULE_0__.jsxDEV)(\"p\", {\n                        children: `Nitesh Surana works as a Senior Threat Researcher with Trend Micro. His passion revolves around Cloud Vulnerability & Security Research, Developer Security, Threat Hunting, building honeypots targeting container environments and finding abuse vectors for cloud services. Previously, Nitesh has been credited for reporting security issues to various companies, startups, and governments. His findings have been recognized by the US Department of Defense, the Zero Day Initiative and his research has been mentioned across ZDNet, BleepingComputer, TheHackerNews, Dark Reading, The Register amongst others. In addition to his previous work in a Managed Security Operations Center and Purple Teaming, he has presented on existing and new research in communities and conferences such as Null/OWASP Bangalore, DecodePH, c0c0n, Security BSides, NDC. Apart from playing with packets and syscalls, Nitesh is found attending concerts and playing music.`\n                    }, void 0, false, {\n                        fileName: \"D:\\\\AmitUpadhyay_MultiQos\\\\ReactTasks\\\\bsides_original\\\\besides\\\\components\\\\JsonFiles\\\\home.js\",\n                        lineNumber: 1747,\n                        columnNumber: 25\n                    }, undefined);\n                }\n            },\n            {\n                title: \"Workshop Speaker\",\n                description: \"Anjali Singh Shukla\",\n                src: _public_images_tech_speaker_anjali_shukla_webp__WEBPACK_IMPORTED_MODULE_40__[\"default\"],\n                ctaText: \"View\",\n                content: ()=>{\n                    return /*#__PURE__*/ (0,react_jsx_dev_runtime__WEBPACK_IMPORTED_MODULE_0__.jsxDEV)(\"p\", {\n                        children: `Anjali Singh is a senior cloud security engineer & founder of Kubernetes Village. She has over 5 years of experience in cloud security ( GCP, AWS & Azure )and DevSecOps (CI/CD), Kubernetes (EKS & GKE), and IAC security. She was a member of the Infosec Girls mentorship program and regularly publishes research on various cloud security via youtube channel @peachycloudsecurity. She was a volunteer at Defcon Cloud Village and currently leads the Bangalore chapter for W3-CS. Additionally, she is an AWS Community Builder. She has delivered training and talks at conferences like Blackhat Spring’24, Blackhat Europe’23, Bsides Bangalore 2023/2024, CSA Bangalore Annual Summit, C0c0n 2023, Null Community Meetup Bangalore, Google Cloud IAP Security at the Cloud Security Podcast, and Nullcon 2023.`\n                    }, void 0, false, {\n                        fileName: \"D:\\\\AmitUpadhyay_MultiQos\\\\ReactTasks\\\\bsides_original\\\\besides\\\\components\\\\JsonFiles\\\\home.js\",\n                        lineNumber: 1760,\n                        columnNumber: 25\n                    }, undefined);\n                }\n            },\n            {\n                title: \"Workshop Speaker\",\n                description: \"Divyanshu Shukla\",\n                src: _public_images_tech_speaker_divyanshu_shukla_webp__WEBPACK_IMPORTED_MODULE_41__[\"default\"],\n                ctaText: \"View\",\n                content: ()=>{\n                    return /*#__PURE__*/ (0,react_jsx_dev_runtime__WEBPACK_IMPORTED_MODULE_0__.jsxDEV)(\"p\", {\n                        children: `Divyanshu is a Senior security engineer with more than 7 years of experience in Security architecture reviews of cloud, Web & Cloud Pentesting, DevSecops, Automation, and Secure Code Review. He has reported multiple vulnerabilities to companies like Airbnb, Google, Microsoft, AWS, Apple, Amazon, Samsung, Zomato, Xiaomi, Alibaba, Opera, Protonmail, Mobikwik, etc, and received CVE-2019-8727 CVE-2019-16918, CVE-2019-12278, CVE-2019-14962 for reporting issues. Author Burp-o-mation and a very-vulnerable-serverless application. Also part of AWS Community Builder for security and was a Defcon Cloud Village crew member 2020/2021/2022. He has also given training and talks in events like Nullcon Hyderabad'24, Brucon'24, Blackchat Europe Arsenal'23, C0c0n'24, Nullcon Goa'24, Bsides Bangalore'23, Parsec IIT Dharwad and Null community. Awarded title of Cloudsecurity Champion CSA Bangalore'23 & Cybersecurity Samurai at the Bsides Bangalore'23.`\n                    }, void 0, false, {\n                        fileName: \"D:\\\\AmitUpadhyay_MultiQos\\\\ReactTasks\\\\bsides_original\\\\besides\\\\components\\\\JsonFiles\\\\home.js\",\n                        lineNumber: 1773,\n                        columnNumber: 25\n                    }, undefined);\n                }\n            },\n            {\n                title: \"Tech Speaker\",\n                description: \"Andrzej Olchawa\",\n                src: _public_images_speaker_andrezj_jpg__WEBPACK_IMPORTED_MODULE_46__[\"default\"],\n                ctaText: \"View\",\n                content: ()=>{\n                    return /*#__PURE__*/ (0,react_jsx_dev_runtime__WEBPACK_IMPORTED_MODULE_0__.jsxDEV)(\"p\", {\n                        children: `Information Security Professional with over 15 years in the space industry, working as a Software Engineer and Technical Project Manager. For the past few years, he has focused on offensive security, specializing in vulnerability research and exploit development. Holds a number of OffSec certifications, and has been credited with several CVEs.`\n                    }, void 0, false, {\n                        fileName: \"D:\\\\AmitUpadhyay_MultiQos\\\\ReactTasks\\\\bsides_original\\\\besides\\\\components\\\\JsonFiles\\\\home.js\",\n                        lineNumber: 1786,\n                        columnNumber: 25\n                    }, undefined);\n                }\n            },\n            {\n                title: \"Tech Speaker\",\n                description: \"Godfather Orwa\",\n                src: _public_images_tech_speaker_godfather_orwa_webp__WEBPACK_IMPORTED_MODULE_42__[\"default\"],\n                ctaText: \"View\",\n                content: ()=>{\n                    return /*#__PURE__*/ (0,react_jsx_dev_runtime__WEBPACK_IMPORTED_MODULE_0__.jsxDEV)(\"p\", {\n                        children: `Godfather Orwa is the remarkable Security Researcher who dedicates their time as a full-time Bug Hunter. He has earned the prestigious title of a Top 5 P1 Warrior on Bugcrowd and triumphed as the Hack Cup Winner in 2022 and 2023. Adding to his achievements, he is also the reigning champion of LevelUpX in 2022 and 2023.`\n                    }, void 0, false, {\n                        fileName: \"D:\\\\AmitUpadhyay_MultiQos\\\\ReactTasks\\\\bsides_original\\\\besides\\\\components\\\\JsonFiles\\\\home.js\",\n                        lineNumber: 1799,\n                        columnNumber: 25\n                    }, undefined);\n                }\n            },\n            {\n                title: \"Tech Speaker\",\n                description: \"Abdullah Abbadi\",\n                src: _public_images_tech_speaker_abdullah_abbadi_webp__WEBPACK_IMPORTED_MODULE_45__[\"default\"],\n                ctaText: \"View\",\n                content: ()=>{\n                    return /*#__PURE__*/ (0,react_jsx_dev_runtime__WEBPACK_IMPORTED_MODULE_0__.jsxDEV)(\"p\", {\n                        children: `Abdullah Abbadi widely known in the cybersecurity world as Hackerx007. Abdullah is a full-time Bug Bounty Hunter with a relentless passion for uncovering critical vulnerabilities. With over 200 critical reports and 15+ 0DAYs on Bugcrowd, he has established himself as a P1 specialist, earning a spot in the top 10 of Bugcrowd's P1 Warrior rankings. Abdullah's expertise in server-side bugs and his love for P1 vulnerabilities have led him to be featured in the Hall of Fame for both Facebook and Twitter. Ranked 58 on Bugcrowd, with an impressive 110 P1 vulnerabilities reported, Abdullah's dedication and skill continue to make a significant impact in the bug bounty community.`\n                    }, void 0, false, {\n                        fileName: \"D:\\\\AmitUpadhyay_MultiQos\\\\ReactTasks\\\\bsides_original\\\\besides\\\\components\\\\JsonFiles\\\\home.js\",\n                        lineNumber: 1812,\n                        columnNumber: 25\n                    }, undefined);\n                }\n            },\n            {\n                title: \"Tech Speaker\",\n                description: \"Kuldeep Pandya\",\n                src: _public_images_tech_speaker_kuldeep_pandya_webp__WEBPACK_IMPORTED_MODULE_48__[\"default\"],\n                ctaText: \"View\",\n                content: ()=>{\n                    return /*#__PURE__*/ (0,react_jsx_dev_runtime__WEBPACK_IMPORTED_MODULE_0__.jsxDEV)(\"p\", {\n                        children: `Kuldeep Pandya is a full-time Bug Bounty Hunter and a respected member of the Synack Red Team. With over 4 years of experience in cybersecurity, Kuldeep has made a name for himself by consistently uncovering vulnerabilities across various domains, including client-side, server-side, mobile, and network security. As the Synack Red Team Envoy for the India region, he has achieved the prestigious Hero ranking for three consecutive years, showcasing his exceptional skills and dedication.\r\nKuldeep's expertise extends to OSINT, web, and binary exploitation, with a particular passion for server-side flaws. His relentless pursuit of security excellence has earned him recognition in the cybersecurity community.`\n                    }, void 0, false, {\n                        fileName: \"D:\\\\AmitUpadhyay_MultiQos\\\\ReactTasks\\\\bsides_original\\\\besides\\\\components\\\\JsonFiles\\\\home.js\",\n                        lineNumber: 1825,\n                        columnNumber: 25\n                    }, undefined);\n                }\n            },\n            {\n                title: \"Tech Speaker\",\n                description: \"Satyam Gothi\",\n                src: _public_images_tech_speaker_satyam_webp__WEBPACK_IMPORTED_MODULE_47__[\"default\"],\n                ctaText: \"View\",\n            